function liveNewsUpdate() {
    response2 = JSON.parse(httpGet(request))
    difference = response2.filter(obj1 => !response.some(obj2 => obj1.header === obj2.header));
    // difference = [response[7]];
    var provinces = []
    var disricts = []
    var tehsils = []
    for (var i = 0; i < difference.length; i++) {
        response.push(difference[i])
    }
    if (difference.length != 0) {
        for (i = 0; i < difference.length; i++) {
            if (difference[i]["locationType"] == "Province") {
                provinces.push(difference[i])
            }
            else if (difference[i]["locationType"] == "District") {
                disricts.push(difference[i])
            }
            else if (difference[i]["locationType"] == "Tehsil") {
                tehsils.push(difference[i])
            }
            areaData = JSON.parse(difference[i]["coordinates"])
            areaData = areaData.geometry.coordinates[0];
            randomX = areaData[Math.floor(Math.random() * areaData.length)]
            randomY = areaData[Math.floor(Math.random() * areaData.length)]
            var coordinate = [];
            for (var j = 0; j < randomX.length; j++) {
                coordinate.push((randomX[j] + randomY[j]) / 2)
            }

        }

        applyNewsToMap(provinces)
        map.createPane('provinces');
        applyNewsToMap(disricts)
        applyNewsToMap(tehsils)
        popup = L.popup()
            .setLatLng([coordinate[1], coordinate[0]])
            .setContent("NEWS Added!")
            .openOn(map);
    }
}



