var geojson = L.geoJson();


function highlightFeature(e) {
    var layer = e.target;

    layer.setStyle({
        weight: 5,
        dashArray: '',
        fillOpacity: 0.7
    });

    // layer.bringToFront();
    if ("TEHSIL" in layer.feature.properties) {
        popup = L.popup()
            .setLatLng(e.latlng)
            .setContent(layer.feature.properties.TEHSIL + ' Tehsil')
            .openOn(map);
    }
    else if ("DISTRICT" in layer.feature.properties) {
        popup = L.popup()
            .setLatLng(e.latlng)
            .setContent(layer.feature.properties.DISTRICT + ' District')
            .openOn(map);
    }
    else {
        popup = L.popup()
            .setLatLng(e.latlng)
            .setContent(layer.feature.properties.PROVINCE + ' Province')
            .openOn(map);
    }


}


function resetHighlight(e) {
    style = e.target.defaultOptions.style
    geojson.resetStyle(e.target);
    e.target.setStyle(style)
    if (popup && map) {
        map.closePopup(popup);
        popup = null;
    }
}


function zoomToFeature(e) {
    var layer = e.target;
    map.fitBounds(e.target.getBounds());
    $('#newscards').empty();
    var location;
    if ("TEHSIL" in layer.feature.properties) {
        location = layer.feature.properties["TEHSIL"]
    }
    else if ("DISTRICT" in layer.feature.properties) {
        location = layer.feature.properties["DISTRICT"]
    }
    else {
        location = layer.feature.properties["PROVINCE"]
    }
    for (var i = response.length - 1; i >= 0; i--) {
        if (location == response[i].focusLocation) {
            if ("picture" in response[i]) {
                $('#newscards').prepend(`<div class="card"> 
            <img src="`+ response[i]["picture"] + `" class="card-img-top"> 
            <div class="card-header">`+ response[i]["focusLocation"] + `</div>
            <div class="card-body">
            <h5 class="card-title">`+ response[i]["header"] + `</h5>
            <p class="card-text">Focus Time: `+ response[i]["focusTime"] + `</p>
            <p class="card-text">Creation Date: `+ response[i]["creationDate"] + `</p>
            <p class="card-text">Categories: `+ String(response[i]["topics"]) + `</p>
            <a target="_blank" href="`+ response[i]["link"] + `" class="card-link">NEWS Link </a>
            </div>
            </div>
            `)
            }
            else {
                $('#newscards').prepend(`<div class="card"> 
            <div class="card-header">`+ response[i]["focusLocation"] + `</div>
            <div class="card-body">
            <h5 class="card-title">`+ response[i]["header"] + `</h5>
            <p class="card-text">Focus Time: `+ response[i]["focusTime"] + `</p>
            <p class="card-text">Creation Date: `+ response[i]["creationDate"] + `</p>
            <p class="card-text">Categories: `+ String(response[i]["topics"]) + `</p>
            <a target="_blank" href="`+ response[i]["link"] + `" class="card-link">NEWS Link </a>
            </div>
            </div>
            `)
            }
        }
    }
}




